class ObjectType {
  static [Symbol.hasInstance](o) {
    return o !== null && typeof o === 'object';
  }
}

function useUpdate(){
  const [, setState] = useState({});
  return useCallback(() => setState({}), [])
}

const oMap = new WeakMap();
const pMap = new WeakMap();
function observer(initialVal, cb) {
  if (oMap.has(initialVal)) oMap.get(initialVal);

  const proxy = new Proxy(initialVal, {
    get(target, key, receiver) {
      const res = Reflect.get(target, key, receiver);
      return res instanceof ObjectType ? observer(res, cb) : res;
    },
    set(target, key, val) {
      const res = Reflect.set(target, key, val);
      cb();
      return res;
    },
    deleteProperty(target, key) {
      const res = Reflect.deleteProperty(target, key);
      cb();
      return res;
    }
  })

  if (pMap.has(proxy)) return pMap.get(proxy);

  oMap.set(initialVal, proxy);
  pMap.set(proxy, initialVal);

  return proxy;
}

function useReactive(initialState) {
  const update = useUpdate();
  const stateRef = useRef(initialState);
  const state = observer(stateRef.current, () => update());
  return state;
}

export default () => {
  const state = useReactive({
    count: 0,
    inputVal: '',
    obj: {
      value: '',
    },
  });

  return (
    <div>
      <p> state.count\uFF1A{state.count}</p>
      <button style={{ marginRight: 8 }} onClick={() => state.count++}>
        state.count++
      </button>
      <button onClick={() => state.count--}>state.count--</button>
      <p style={{ marginTop: 20 }}> state.inputVal: {state.inputVal}</p>
      <input onChange={e => (state.inputVal = e.target.value)} />
      <p style={{ marginTop: 20 }}> state.obj.value: {state.obj.value}</p>
      <input onChange={e => (state.obj.value = e.target.value)} />
    </div>
  );
};`},react:{type:"NPM",value:"18.1.0"}}}}},S={title:"useReactive",toc:"menu",filename:"docs/react/hooks-custom-use_reactive.md",order:3,group:{title:"hooks-custom"}},te=[],je=[],Be={},Ze={title:"web\u5B89\u5168",toc:"menu",filename:"docs/browser/browser-web_security.md",order:1,group:{title:"browser",order:1},description:"\u8DE8\u7AD9\u811A\u672C\u653B\u51FB XSS(Cross Site Scripting)"},Mt=[],Ct=[{value:"\u8DE8\u7AD9\u811A\u672C\u653B\u51FB XSS(Cross Site Scripting)",paraId:0},{value:"\u4ECB\u7ECD\uFF1Aweb \u9875\u9762\u63D2\u5165\u6076\u610F script\uFF0C\u8BBF\u95EE\u9875\u9762\u65F6\u6076\u610F\u811A\u672C\u6267\u884C\u653B\u51FB\u7528\u6237",paraId:1},{value:"\u9632\u5FA1\uFF1A",paraId:2},{value:`
